{
  "root": true,
  "ignorePatterns": ["**/*"],
  "plugins": ["@nx"],
  "overrides": [
    {
      "files": ["*.ts", "*.tsx", "*.js", "*.jsx", "*.vue"],
      "rules": {
        "@nx/enforce-module-boundaries": [
          "error",
          {
            "enforceBuildableLibDependency": true,
            "allow": [],
            "depConstraints": [
              {
                "sourceTag": "*",
                "onlyDependOnLibsWithTags": ["*"]
              }
            ]
          }
        ]
      }
    },
    {
      "files": ["*.ts", "*.tsx"],
      "extends": ["plugin:@nx/typescript"],
      "rules": {}
    },
    {
      "files": ["*.js", "*.jsx"],
      "extends": ["plugin:@nx/javascript"],
      "rules": {}
    }
  ]
}

{
  "extends": [
    "development"
  ],
  "hints": {
    "typescript-config/is-valid": "off",
    "axe/name-role-value": "off",
    "typescript-config/strict": "off"
  }
}

module.exports = {
    parserPreset: 'conventional-changelog-conventionalcommits',
    rules: {
        'body-leading-blank': [1, 'always'],
        'body-max-line-length': [2, 'always', 100],
        'footer-leading-blank': [1, 'always'],
        'footer-max-line-length': [2, 'always', 100],
        'header-max-length': [2, 'always', 100],
        'subject-empty': [2, 'never'],
        'subject-full-stop': [2, 'never', '.'],
        'type-case': [2, 'always', 'lower-case'],
        'type-empty': [2, 'never'],
        'type-enum': [
            2,
            'always',
            [
                'build',
                'chore',
                'ci',
                'docs',
                'feat',
                'fix',
                'perf',
                'refactor',
                'revert',
                'style',
                'test',
            ],
        ],
    },
    prompt: {
        questions: {
            type: {
                description: "Select the type of change that you're committing",
                enum: {
                    feat: {
                        description: 'A new feature',
                        title: 'Features',
                        emoji: '✨',
                    },
                    fix: {
                        description: 'A bug fix',
                        title: 'Bug Fixes',
                        emoji: '🐛',
                    },
                    docs: {
                        description: 'Documentation only changes',
                        title: 'Documentation',
                        emoji: '📚',
                    },
                    style: {
                        description:
                            'Changes that do not affect the meaning of the code (white-space, formatting, missing semi-colons, etc)',
                        title: 'Styles',
                        emoji: '💎',
                    },
                    refactor: {
                        description:
                            'A code change that neither fixes a bug nor adds a feature',
                        title: 'Code Refactoring',
                        emoji: '📦',
                    },
                    perf: {
                        description: 'A code change that improves performance',
                        title: 'Performance Improvements',
                        emoji: '🚀',
                    },
                    test: {
                        description: 'Adding missing tests or correcting existing tests',
                        title: 'Tests',
                        emoji: '🚨',
                    },
                    build: {
                        description:
                            'Changes that affect the build system or external dependencies (example scopes: gulp, broccoli, npm)',
                        title: 'Builds',
                        emoji: '🛠',
                    },
                    ci: {
                        description:
                            'Changes to our CI configuration files and scripts (example scopes: Travis, Circle, BrowserStack, SauceLabs)',
                        title: 'Continuous Integrations',
                        emoji: '⚙️',
                    },
                    chore: {
                        description: "Other changes that don't modify src or test files",
                        title: 'Chores',
                        emoji: '♻️',
                    },
                    revert: {
                        description: 'Reverts a previous commit',
                        title: 'Reverts',
                        emoji: '🗑',
                    },
                },
            },
            scope: {
                description:
                    'What is the scope of this change (e.g. component or file name)',
            },
            subject: {
                description:
                    'Write a short, imperative tense description of the change',
            },
            body: {
                description: 'Provide a longer description of the change',
            },
            isBreaking: {
                description: 'Are there any breaking changes?',
            },
            breakingBody: {
                description:
                    'A BREAKING CHANGE commit requires a body. Please enter a longer description of the commit itself',
            },
            breaking: {
                description: 'Describe the breaking changes',
            },
            isIssueAffected: {
                description: 'Does this change affect any open issues?',
            },
            issuesBody: {
                description:
                    'If issues are closed, the commit requires a body. Please enter a longer description of the commit itself',
            },
            issues: {
                description: 'Add issue references (e.g. "fix #123", "re #123".)',
            },
        },
    },
};

{
    "folders": [
        {
            "name": "Wizarr [Frontend]",
            "path": "./apps/wizarr-frontend"
        },
        {
            "name": "Wizarr [Backend]",
            "path": "./apps/wizarr-backend"
        },
        {
            "name": "Wizarr [E2E]",
            "path": "./apps/wizarr-e2e"
        },
        {
            "name": "Wizarr [Project]",
            "path": "."
        }
    ],
    "settings": {
        "files.exclude": {
            "**/apps/": true
        },
        "search.exclude": {
            "**/node_modules": true,
            "**/bower_components": true,
            "**/*.code-search": true,
            "**/language": true,
            "**/apps/wizarr-frontend/src/language": true
        },
        "commit-message-editor.staticTemplate": ["feat: Short description", "", "Message body", "", "Message footer"],
        "commit-message-editor.dynamicTemplate": ["{type}{scope}: {description}", "", "{body}", "", "{skip_ci}", "", "{breaking_change}{footer}"],
        "commit-message-editor.tokens": [
            {
                "label": "Type",
                "name": "type",
                "type": "enum",
                "options": [
                    {
                        "label": "---",
                        "value": ""
                    },
                    {
                        "label": "build",
                        "description": "Changes that affect the build system or external dependencies (example scopes: gulp, broccoli, npm)"
                    },
                    {
                        "label": "chore",
                        "description": "Updating grunt tasks etc; no production code change"
                    },
                    {
                        "label": "ci",
                        "description": "Changes to our CI configuration files and scripts (example scopes: Travis, Circle, BrowserStack, SauceLabs)"
                    },
                    {
                        "label": "docs",
                        "description": "Documentation only changes"
                    },
                    {
                        "label": "feat",
                        "description": "A new feature"
                    },
                    {
                        "label": "fix",
                        "description": "A bug fix"
                    },
                    {
                        "label": "perf",
                        "description": "A code change that improves performance"
                    },
                    {
                        "label": "refactor",
                        "description": "A code change that neither fixes a bug nor adds a feature"
                    },
                    {
                        "label": "revert"
                    },
                    {
                        "label": "style",
                        "description": "Changes that do not affect the meaning of the code (white-space, formatting, missing semi-colons, etc)"
                    },
                    {
                        "label": "test",
                        "description": "Adding missing tests or correcting existing tests"
                    }
                ],
                "description": "Type of changes"
            },
            {
                "label": "Scope",
                "name": "scope",
                "description": "A scope may be provided to a commit’s type, to provide additional contextual information and is contained within parenthesis, e.g., \"feat(parser): add ability to parse arrays\".",
                "type": "text",
                "multiline": false,
                "prefix": "(",
                "suffix": ")"
            },
            {
                "label": "Short description",
                "name": "description",
                "description": "Short description in the subject line.",
                "type": "text",
                "multiline": false
            },
            {
                "label": "Body",
                "name": "body",
                "description": "Optional body",
                "type": "text",
                "multiline": true,
                "lines": 5,
                "maxLines": 10
            },
            {
                "label": "Breaking change",
                "name": "breaking_change",
                "type": "boolean",
                "value": "BREAKING CHANGE: "
            },
            {
                "label": "Footer",
                "name": "footer",
                "description": "Optional footer",
                "type": "text",
                "multiline": true
            },
            {
                "label": "Skip CI",
                "name": "skip_ci",
                "type": "boolean",
                "value": "[skip ci]"
            }
        ],
        "commit-message-editor.view.defaultView": "form",
        "commit-message-editor.view.visibleViews": "form"
    }
}

{
    "$schema": "./node_modules/nx/schemas/nx-schema.json",
    "targetDefaults": {
        "build": {
            "cache": true,
            "dependsOn": ["^build"],
            "inputs": ["production", "^production"]
        },
        "docker": {
            "executor": "@nrwl/workspace:run-commands",
            "options": {
                "command": "docker build -t $npm_package_name .",
                "cwd": "$npm_package_name",
                "color": "yellow"
            },
            "outputs": ["$npm_package_name"]
        },
        "lint": {
            "cache": true,
            "inputs": ["default", "{workspaceRoot}/.eslintrc.json", "{workspaceRoot}/.eslintignore", "{workspaceRoot}/eslint.config.js"]
        },
        "test": {
            "cache": true,
            "inputs": ["default", "^production", "{workspaceRoot}/jest.preset.js"]
        },
        "e2e": {
            "cache": true,
            "inputs": ["default", "^production"]
        },
        "build-storybook": {
            "cache": true,
            "inputs": ["default", "^production", "{projectRoot}/.storybook/**/*", "{projectRoot}/tsconfig.storybook.json"]
        }
    },
    "namedInputs": {
        "default": ["{projectRoot}/**/*", "sharedGlobals"],
        "production": ["default", "!{projectRoot}/.eslintrc.json", "!{projectRoot}/eslint.config.js", "!{projectRoot}/**/?(*.)+(spec|test).[jt]s?(x)?(.snap)", "!{projectRoot}/tsconfig.spec.json", "!{projectRoot}/jest.config.[jt]s", "!{projectRoot}/src/test-setup.[jt]s", "!{projectRoot}/test-setup.[jt]s", "!{projectRoot}/**/*.stories.@(js|jsx|ts|tsx|mdx)", "!{projectRoot}/.storybook/**/*", "!{projectRoot}/tsconfig.storybook.json"],
        "sharedGlobals": []
    },
    "plugins": ["@nxlv/python"],
    "nxCloudAccessToken": "ZGVkMzdiZGQtZTk3Ny00MDFmLTljNWQtYzQ2Zjk4ZWNkY2VmfHJlYWQtd3JpdGU=",
    "generators": {
        "@nx/web:application": {
            "style": "css",
            "linter": "eslint",
            "unitTestRunner": "jest",
            "e2eTestRunner": "cypress"
        }
    },
    "tasksRunnerOptions": {
        "default": {
            "options": {
                "cacheableOperations": ["build-storybook"]
            }
        }
    }
}

// Store the current branch in a variable
const branch = process.env.CURRENT_BRANCH || "master";

if (!branch) {
    throw new Error("CURRENT_BRANCH not set");
}

const isBeta = branch === "beta";
const isMaster = branch === "master" || branch === "main";

/**
 * @type {import("semantic-release").GlobalConfig}
 */
const config = {
    branches: ["main", "master", { name: "beta", prerelease: true }],
    plugins: [
        [
            "@semantic-release/exec",
            {
                // use semantic-release logger to print the branch name
                prepareCmd: 'echo "Branch: ${branch}"',
            },
        ],
        [
            "@semantic-release/commit-analyzer",
            {
                // Modify default release rules to include types that are not breaking change, feat, or fix as a patch release
                // Default rules: https://github.com/semantic-release/commit-analyzer/blob/master/lib/default-release-rules.js
                releaseRules: [
                    {
                        scope: "no-release",
                        release: false,
                    },
                    {
                        type: "build",
                        release: "patch",
                    },
                    {
                        type: "ci",
                        release: "patch",
                    },
                    {
                        type: "chore",
                        release: "patch",
                    },
                    {
                        type: "docs",
                        release: "patch",
                    },
                    {
                        type: "refactor",
                        release: "patch",
                    },
                    {
                        type: "style",
                        release: "patch",
                    },
                    // {
                    //     type: "test",
                    //     release: "patch",
                    // },
                    {
                        breaking: true,
                        release: "major",
                    },
                ],
            },
        ],
        [
            "@semantic-release/release-notes-generator",
            {
                preset: "conventionalcommits",
                presetConfig: {
                    types: [
                        { type: "feat", section: "New Features" },
                        { type: "fix", section: "Bug Fixes" },
                        { type: "perf", section: "Performance Improvements", hidden: false },
                        { type: "revert", section: "Commit Reverts", hidden: false },
                        { type: "build", section: "Build System", hidden: false },
                        { type: "ci", section: "Continuous Integration", hidden: false },
                        { type: "chore", section: "Chores", hidden: false },
                        { type: "docs", section: "Documentation", hidden: false },
                        { type: "style", section: "Style Changes", hidden: false },
                        { type: "refactor", section: "Code Refactoring", hidden: false },
                        { type: "test", section: "Test Cases", hidden: true },
                    ],
                },
            },
        ],
        [
            "@semantic-release/changelog",
            {
                changelogFile: isBeta ? "CHANGELOG-beta.md" : "CHANGELOG.md",
            },
        ],
        [
            "@semantic-release/exec",
            {
                prepareCmd: 'echo "${nextRelease.version}" > latest',
            },
        ],
        [
            "@semantic-release/git",
            {
                assets: ["CHANGELOG.md", "CHANGELOG-beta.md", "latest"],
                message: "chore(release): ${nextRelease.version}\n\n${nextRelease.notes}",
            },
        ],
        "@wizarrrr/semantic-release-discord",
        [
            "@wizarrrr/semantic-release-sentry-releases",
            {
                sourcemaps: "dist/apps/wizarr-frontend",
            },
        ],
    ],
};

if (isMaster) {
    config.plugins.splice(-2, 0, "@semantic-release/github");
}

module.exports = config;

{
    "folders": [
        {
            "path": "."
        }
    ]
}
